import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import '../styles/header.css';

const Header = () => {
  const [scrolled, setScrolled] = useState(false);
  const [menuOpen, setMenuOpen] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      if (window.scrollY > 50) {
        setScrolled(true);
      } else {
        setScrolled(false);
      }
    };

    window.addEventListener('scroll', handleScroll);
    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);

  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  return (
    <header className={`site-header ${scrolled ? 'scrolled' : ''}`}>
      <div className="header-container">
        <div className="header-logo">
          <Link to="/">
            <img 
              src="/images/logo.png" 
              alt="Logo" 
              className="logo"
              onError={(e) => {
                e.target.src = 'https://via.placeholder.com/150x50?text=LOGO';
              }}
            />
          </Link>
        </div>

        <button 
          className={`mobile-menu-toggle ${menuOpen ? 'active' : ''}`}
          onClick={toggleMenu}
          aria-label="Toggle menu"
        >
          <span></span>
          <span></span>
          <span></span>
        </button>

        <nav className={`main-nav ${menuOpen ? 'open' : ''}`}>
          <ul className="nav-links">
            <li className="nav-item">
              <Link to="/" className="nav-link">Home</Link>
            </li>
            <li className="nav-item">
              <Link to="/about" className="nav-link">About</Link>
            </li>
            <li className="nav-item dropdown">
              <span className="nav-link dropdown-toggle">Services</span>
              <ul className="dropdown-menu">
                <li><a href="https://searchmycolleges.com/" target="_blank" rel="noopener noreferrer">Search My Colleges</a></li>
                <li><a href="https://searchmytrips.com/" target="_blank" rel="noopener noreferrer">Search My Trips</a></li>
                <li><a href="https://searchmymedical.com/" target="_blank" rel="noopener noreferrer">Search My Medical</a></li>
              </ul>
            </li>
            <li className="nav-item">
              <Link to="/next" className="nav-link">NExT</Link>
            </li>
            <li className="nav-item dropdown">
              <span className="nav-link dropdown-toggle">Quizzes</span>
              <ul className="dropdown-menu">
                <li><Link to="/mock-tests">Mock Tests</Link></li>
                <li><Link to="/courses">Courses</Link></li>
                <li><Link to="/study-materials">Study Materials</Link></li>
              </ul>
            </li>
            <li className="nav-item">
              <Link to="/blogs" className="nav-link">Blogs</Link>
            </li>
            <li className="nav-item">
              <Link to="/articles" className="nav-link">Articles</Link>
            </li>
            <li className="nav-item">
              <Link to="/contact" className="nav-link">Contact</Link>
            </li>
          </ul>
        </nav>

        <div className="auth-buttons">
          <Link to="/login" className="login-btn">Login</Link>
        </div>
      </div>
    </header>
  );
};

export default Header;
